
<!DOCTYPE html>
<html>

<body>
    <canvas id='canvas' width='744' height='1052'></canvas>
    <script>

// #layer1

	ctx.moveTo(145.714280, 124.008060);

	ctx.lineTo(388.571430, 269.505060);
	ctx.quadraticCurveTo(388.571430, 269.505060, 388.571430, 255.002060);
	ctx.lineTo(388.571430, 124.008060);

	ctx.lineTo(145.714280, 109.505060);
	ctx.quadraticCurveTo(145.714280, 109.505060, 145.714280, 124.008060);

	ctx.stroke();
